"Kırmızı - Mavi Minecraft'ın mini savaş oyunudur. Sunucunun oyuncuları PVP savaşları için kırmızı/mavi ekibe rastgele olarak atanır. Belirli sayıdaki düşmana ilk sahip olan ekip kazanır.

 Kurallar ve prosedürler:
 1.Sunucu sahibinin sunucu kapasitesini (çift sayı olmalıdır) ve kazanma şartını (örneğin, öldürdüğün düşman sayısı) belirlemesi gerekmektedir;
 2. Diğer oyuncuların sunucuya katılması bekleniyor, dolduktan sonra, başlamak için \"başla\" ya tıkla;
 3. Sunucudaki tüm oyuncular rastgele olarak iki ekibe ayrılmıştır: Kırmızı Ekip ve Mavi Ekip. Ekiplerin oyuncularının takma adları kırmızı ve mavi renklerle ayırt edilebilmektedir; oyunun başlaması için geri sayıma başlandığında hangi takımda olduğun sana hatırlatılacak;
 4.Oyun esnasında, bir düşman oyuncu öldürüldüğünde 1 öldürme olarak sayılır; bir ekip oyuncusu öldürüldüğünde 1 katliam olarak sayılır; bir düşman/ekip oyuncusu tarafından öldürülme 1 ölüm olarak sayılır; kazara ölmek (örnek olarak, düşerek ölmek, canavarlar tarafından öldürülmek, v.b.) 1 ölüm olarak sayılır;
 5. Yeniden doğan oyuncular oyunun sonuna kadar ya da kazanan belirlendiğinde savaşa tekrar katılabilir;
 6. Her oyun maksimum 25 dakika sürer. 25 dakika içinde belirli sayıdaki düşmanı ilk öldüren ekip kazanır.
 7. Her iki ekip de 25 dakika içinde belirlenmiş sayıdaki düşmana ulaşamazsa, en çok düşmanı öldüren kazanacaktır; her iki ekip de aynı sayıdaki düşmanı öldürmüşse, oyun berabere sona erer;
 8. Bir oyuncu çevrimdışı olur ya da sunucudan ayrılırsa oyun devam eder; eğer bir ekibin tüm oyuncuları çevrimdışı olur ya da sunucuyu terk ederse, diğer ekip kazanan olarak ilan edilecektir;"
